    return (
        <div className="mobile-specs">
            <div className="mobile-image"><img src= {image}/></div>
            <div className = "mobile-info"><h2>vivo T2x 5G</h2>
          <p className= "mobile-brand">By Vivo</p>
           <p className= "mobile-price">$ 1000</p>
          <button>Buy Now</button>
            </div>
        </div>
    )
}

